import React, { useEffect, useState } from 'react';
import { GoogleMap, LoadScript, Ad, InfoWindow, OverlayView, MarkerF, MarkerClusterer, Marker} from '@react-google-maps/api';
import "./Map.css";
const containerStyle = {
  width: '100%',
  height: '400px'
};

// 서울의 초기 위치
const defaultCenter = {
  lat: 37.5665,
  lng: 126.9780
};
// 각 마커 유형에 따른 아이콘 색상 정의
const markerIcons = {
  "따릉이": "http://maps.google.com/mapfiles/ms/icons/green-dot.png",
  "주차장": "http://maps.google.com/mapfiles/ms/icons/blue-dot.png",
  "문화행사": "http://maps.google.com/mapfiles/ms/icons/red-dot.png",
  "지하철": "http://maps.google.com/mapfiles/ms/icons/yellow-dot.png"
};

const Map = ({ information }) => {
  const [currentPosition, setCurrentPosition] = useState(defaultCenter);
  const [markers, setMarkers] = useState([]);
  const [activeMarker, setActiveMarker] = useState(null);

  console.log("맵에 잘 넘어왔나 확인용 : ", information);

  // 예상과 다르게 구조화된 경우 아래와 같이 처리할 수 있습니다.
  const prkStts = information.PRK_STTS || [];
  const sbikeStts = information.SBIKE_STTS || [];
  const subStts = information.SUB_STTS || [];
  const eventStts = information.EVENT_STTS || [];

  console.log("주차 상태:", prkStts);
  console.log("자전거 상태:", sbikeStts);
  console.log("지하철 상태:", subStts);
  console.log("이벤트 상태:", eventStts);

  useEffect(() => {
    // 현재 위치를 설정
    if ('geolocation' in navigator) {
      navigator.geolocation.getCurrentPosition((position) => {
        const { latitude, longitude } = position.coords;
        setCurrentPosition({
          lat: latitude,
          lng: longitude
        });
        console.log("Current Position:", latitude, longitude);  // 현재 위치 로그 출력
      }, () => {
        console.error("Geolocation is not supported or permission denied.");
      });
    } else {
      console.error("Geolocation is not supported by this browser.");
    }
  }, []);

  useEffect(() => {
    // 선택된 필터에 해당하는 목업 데이터를 마커로 설정
    // const filteredMarkers = mockData.filter(item => selectedFilters.includes(item.type));
    // setMarkers(filteredMarkers);
  }, []);

  // 마커 클릭 시 InfoWindow를 활성화하는 함수
  const handleMarkerClick = (marker) => {
    setActiveMarker(marker);
  };

  // InfoWindow 닫기
  const handleInfoWindowClose = () => {
    setActiveMarker(null);
  };

  const getPixelPositionOffset = (width, height) => ({
    x: -(width / 2),
    y: -(height + 20) // Adjust y position based on your need
  });

  return (
    <LoadScript googleMapsApiKey="AIzaSyCoBqm6ZJlc2QRPAEZ8Op36nAklnfj5DsE">
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={currentPosition}
        zoom={13}
      >
        {/* 현재 위치에 마커 표시 */}
        <MarkerF position={currentPosition} title="현재 위치" />

        {markers.map((marker, index) => (
          <div key={index}>
            <Marker
              position={{ lat: marker.lat, lng: marker.lng }}
              icon={markerIcons[marker.type] || "http://maps.google.com/mapfiles/ms/icons/yellow-dot.png"} // 기본 마커 색상
              title={marker.name}
              onClick={() => handleMarkerClick(marker)}
            />
          </div>
        ))}
        {/* 활성화된 마커에 정보창 표시 */}
        {activeMarker && (
          <InfoWindow
            position={{ lat: activeMarker.lat, lng: activeMarker.lng }}
            onCloseClick={handleInfoWindowClose}
          >
            <div>
              <h4>{activeMarker.name}</h4>
              <p>주소: {activeMarker.address}</p>
              <p>전화번호: {activeMarker.phoneNumber}</p>
              <p>웹사이트: {activeMarker.website}</p>
            </div>
          </InfoWindow>
        )}
      </GoogleMap>
    </LoadScript>
  );
};

export default Map;
